import { Text } from "react-native-web";
import { createMaterialTopTabNavigator } from "@react-navigation/material-top-tabs";
import LoginForm from "./LoginForm";
import Saludar from "./Saludar";
const Tab = createMaterialTopTabNavigator();
function StackNavigatorOne() {
  const Stack = createStackNavigator();
  return (
    <Stack.Navigator>
      <Stack.Screen name="Screen1" component={LoginForm} />
      <Stack.Screen name="Screen2" component={Saludar} />
    </Stack.Navigator>
  );
}

function StackNavigatorTwo() {
  const Stack = createStackNavigator();
  return (
    <Stack.Navigator>
      <Stack.Screen name="Screen3" component={LoginForm} />
      <Stack.Screen name="Screen4" component={Saludar} />
    </Stack.Navigator>
  );
}

function BottomLevelTabs() {
  const BottomTab = createMaterialBottomTabNavigator();
  return (
    <BottomTab.Navigator>
      <BottomTab.Screen name="Tab1" component={LoginForm} />
      <BottomTab.Screen name="Tab2" component={Saludar} />
    </BottomTab.Navigator>
  );
}
export default function Menu() {
  return (
    <Tab.Navigator>
      <Tab.Screen name="Tab1" component={StackNavigatorOne} />
      <Tab.Screen name="Tab2" component={StackNavigatorTwo} />
      <Tab.Screen name="Tab3" component={BottomLevelTabs} />
    </Tab.Navigator>
  );
}
